import { Component } from "react";
import styles from './TopContainer.module.css';

export default class TopContainer extends Component {
    constructor(props) {
        let mainContStyles = {
            'height': '100vh',
            'width': '100%',
            'display': 'flex',
            'justify-content': 'center',
            'align-items': 'center',
            'background': 'red'
        }
    }

    render() {
        return(
            <div styles={this.mainContStyles}>
                <div className={styles.partContainer}></div>
                <div className={styles.partContainer}></div>
            </div>
        )
    }
}
